import React, { Component } from "react";

class Item extends Component {
  // 8ms17ss
  showLevelEle = (item) => {
    let levelEle = null;
    let label = null;
    if (item.level === 0) {
      levelEle = "Beginer";
      label = "label label-primary";
    } else if (item.level === 1) {
      levelEle = "Small";
      label = "label label-warning";
    } else if (item.level === 2) {
      levelEle = "Medium";
      label = "label label-info";
    } else if (item.level === 3) {
      levelEle = "High";
      label = "label label-success";
    }
    return <span className={label}>{levelEle}</span>;
  };

  render() {
    const { idx, item } = this.props;
    // console.log(item); //40ss

    // 5ms47ss
    let levelEle = null;
    let label = null;
    if (item.level === 0) {
      levelEle = "Beginer";
      label = "label label-primary";
    } else if (item.level === 1) {
      levelEle = "Small";
      label = "label label-warning";
    } else if (item.level === 2) {
      levelEle = "Medium";
      label = "label label-info";
    } else if (item.level === 3) {
      levelEle = "High";
      label = "label label-success";
    }

    return (
      // 3ms01ss
      <tr>
        <td className="text-center">{idx}</td>
        <td>{item.name}</td>
        <td className="text-center">
          {/* 5ms47ss, 8ms17ss */}
          {this.showLevelEle(item.level)}
          {/* <span className={label}>{levelEle}</span> */}
        </td>
        <td>
          <button type="button" className="btn btn-warning">
            Edit
          </button>
          <button type="button" className="btn btn-danger">
            Delete
          </button>
        </td>
      </tr>
    );
  }
}

export default Item;
